import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import "materialize-css/dist/css/materialize.min.css";
// ========================================
import M from "materialize-css";

class LoginNav extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }

  render() {
    return (
      <nav>
        <div className="nav-wrapper black">
          <a href="#" className="brand-logo">
            The SCARS Project
          </a>
          <ul id="nav-mobile" className="right hide-on-med-and-down">
            <li>
              <a className="waves-effect waves-light btn green" href="#">
                Sign-Up
              </a>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
class WelcomeNav extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }

  render() {
    return (
      <nav>
        <div className="nav-wrapper black">
          <a href="#" className="brand-logo">
            The SCARS Project
          </a>
          <ul id="nav-mobile" className="right hide-on-med-and-down">
            <li>
              <a className="waves-effect waves-light btn green" href="#">
                Sign-In
              </a>
              <a className="waves-effect waves-light btn green" href="#">
                Sign-In
              </a>
              <a className="waves-effect waves-light btn green" href="#">
                Sign-In
              </a>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
class LoginForm extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }
  render() {
    return (
      <>
        <div className="row">
          <div className="col s12 m6 offset-m3 card center">
            <div className="input-field col s12">
              <input
                className="validate"
                type="text"
                name="username"
                id="email"
                required
              />
              <label for="email">Username</label>
            </div>

            <div className="input-field col s12">
              <input
                className="validate"
                type="password"
                name="password"
                id="password"
                required
              />
              <label for="password">Password</label>
            </div>
            <button className="btn btn-small green waves-effect">Login</button>
          </div>
        </div>
      </>
    );
  }
}
class Footer extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }
  render() {
    return (
      <footer className="page-footer">
        <div className="container">
          <div className="row">
            <div className="col l6 s12">
              <h5 className="white-text">The SCARS Project</h5>
              <p className="grey-text text-lighten-4">
                Web tools for your graphing needs.
              </p>
            </div>
          </div>
        </div>
        <div className="footer-copyright">
          <div className="container">
            Â© 2014 Copyright Text
            <a className="grey-text text-lighten-4 right" href="#!">
              More Links
            </a>
          </div>
        </div>
      </footer>
    );
  }
}

ReactDOM.render(
  <>
    <LoginNav />
    <LoginForm />
  </>,
  document.getElementById("root")
);
